import { Component } from '@angular/core';

@Component({
  selector: 'app-nav-bar',
  templateUrl: './nav-bar.component.html',
  styleUrls: ['./nav-bar.component.css'],
})
export class NavBarComponent {
  countries = [
    { countryName: 'england' },
    { countryName: 'spain' },
    { countryName: 'germany' },
    { countryName: 'france' },
    { countryName: 'italy' },
  ];
}
